chrome.runtime.onMessage.addListener(function (msg, sender, sendResponse) {
    if (msg.text === 'get_background_color') {
        let bodyBackgroundColor = document.body.style.backgroundColor || 'transparent';

        sendResponse(bodyBackgroundColor);
    } else if (msg.text === 'erase_images') {
        const nrOfImages = document.images.length;

        for (let i=0; i < nrOfImages; i++)
        {
            document.images[i].src = 'data:image/jpeg;base64,';
        }

        sendResponse(true);
    }
});

